import React from 'react';
import { Link } from 'react-router-dom';
import '../style.css'; // Ensure your CSS file's path is correct
import { FaFacebook } from "react-icons/fa";
import { FaInstagramSquare } from "react-icons/fa";


const Footer = () => {
  return (
    <div className='footer'>
        <div className="subscribe">
            <p className="scr_text">SUBSCRIBE FOR FURTHER CAREER OPPORTUNITIES</p>
            <div className="subscribe_input">
               <input id="input_scr" type="email" placeholder="Enter your email"/>
               <button id="scr_button">SUBSCRIBE</button>
            </div>
        </div>

        <div className="foot">
            <div id="logo" className="logo">
                {/* Assuming you want to link to the homepage when clicking the logo */}
                <Link to="/">Seeker<br/><span className="nh">Nursing Home</span></Link>
            </div>

            <div className="foot_items">
                <p className="foot_title">SEEKER</p>
                {/* Update hrefs to use Link components */}
                <p><Link to="/" className="footer-link">Home</Link></p>
                <p><Link to="/about-us" className="footer-link">About</Link></p>
                <p><Link to="/community" className="footer-link">Our Community</Link></p>
                <p><Link to="/highlight" className="footer-link">Highlight</Link></p>
            </div>

            {/* Services and Events sections can remain as they are if they're not linking to internal routes */}

            <div className="foot_items">
                <p className="foot_title">FOLLOW US</p>
                <p><FaFacebook /></p>
                <p><FaInstagramSquare/></p>
            </div>

        </div>

        <div className="divider"></div>

        <div className="end_foot">
            <div className="terms">
                {/* Update hrefs to use Link components */}
                <p className="terms_title"><Link to="/terms-and-conditions" className="footer-link">TERMS AND CONDITIONS</Link></p>
                <p className="terms_title"><Link to="/privacy-policy" className="footer-link">PRIVACY POLICY</Link></p>
                <p className="terms_title"><Link to="/sitemap" className="footer-link">SITEMAP</Link></p>
            </div>

            <div className="cpr">
                {/* Copyright information can stay as plain text */}
            </div>
        </div>
    </div>
  );
};

export default Footer;
